import React from 'react';
import { TouchableOpacity, View } from 'react-native';
import { heightPercentageToDP as hp } from 'react-native-responsive-screen';
import FAIcon from 'react-native-vector-icons/FontAwesome';
import { MowButtonBasic } from '../../../components/ui/Common/Button/MowButton';
import { mowColors } from '../../../values/Colors/MowColors';
import { fontFamily, gPadding } from '../../../values/Styles/MowStyles';

export const Search = ({ navigation }): React.ReactElement => {

    return (
        <View
            style={
                {
                    backgroundColor: mowColors.mainColor,
                    paddingHorizontal: gPadding,
                    alignItems: 'center',
                    flexDirection: 'row',
                    justifyContent: 'space-between',
                    paddingBottom: hp(1),
                }
            }>

            <MowButtonBasic
                onPress={() => { navigation.navigate('Search'); }}
                containerStyle={{ width: '85%', alignSelf: 'flex-end', borderRadius: 30, height: hp('5%') }}
                textStyle={
                    {
                        padding: 0,
                        margin: 0,
                        color: '#aeaeae',
                        fontSize: hp('1.6%'),
                        fontFamily: fontFamily.light,
                        fontStyle: 'normal',
                        letterSpacing: 0,
                        textAlign: 'left'
                    }
                }
                leftIconStyle={{ color: '#aeaeae' }}
                leftIcon={'search'}>

                Search

            </MowButtonBasic>

            <TouchableOpacity
                onPress={() => { navigation.openDrawer(); }}
                style={{ height: hp('3%'), width: hp('3%') }}>

                <FAIcon
                    style={{ color: 'white', fontSize: hp('3%') }}
                    name={'bars'} />

            </TouchableOpacity>

        </View>
    )
};
